import React from 'react';
import CarLayout from '../components/CarLayout';
import Navbar from '../navbar';

function Carhome() {

    return (
        <>
            <Navbar />
            <CarLayout>
                <h1>Carhome</h1>
            </CarLayout>
        </>
    )
}

export default Carhome;
